import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Homepage.css';

const Homepage = ({ isLoggedIn }) => {
    const navigate = useNavigate();

    return (
        <div className="homepage">
            {/* Kullanıcı İşlemleri */}
            <div className="hamburger-icon right">
                ☰
            </div>
            <div className="hamburger-menu right-menu open">
                <h3>Kullanıcı İşlemleri</h3>
                <ul>
                    {isLoggedIn ? (
                        <>
                            <li>Favoriler</li>
                            <li>Arama Geçmişi</li>
                            <li>Hesap Ayarları</li>
                            <li onClick={() => alert('Çıkış yapıldı.')}>
                                Çıkış Yap
                            </li>
                        </>
                    ) : (
                        <li onClick={() => navigate('/login')}>Giriş Yap</li>
                    )}
                </ul>
            </div>

            {/* Ana Sayfa İçeriği */}
            <h1>Hoş Geldiniz!</h1>
        </div>
    );
};

export default Homepage;
